import "../styles/Itpages.css"
function Itpages(props) {
  return (
    <>
    <div className="it-card">
      <h1>{props.title}</h1>
      <img src={props.src} alt={props.description} />
      <p>{props.description}</p>
      </div>
    </>
  );
}
export default Itpages;
